            CheckStatus(g_pOrt->CreateTensorWithDataAsOrtValue(
                    memory_info,
                    cur_cida_tensor->pValue,
                    cur_cida_tensor->nValueLen,
                    ptModelHdl->m_vecInputNodesDims[i].data(),
                    ptModelHdl->m_vecInputNodesDims[i].size(),
                    ONNX_TENSOR_ELEMENT_DATA_TYPE_FLOAT,
                    &input_tensor));
        } else if (cur_cida_tensor_param->type == DT_UINT8) {
            CheckStatus(g_pOrt->CreateTensorWithDataAsOrtValue(
                    memory_info,
                    cur_cida_tensor->pValue,
                    cur_cida_tensor->nValueLen,
                    ptModelHdl->m_vecInputNodesDims[i].data(),
                    ptModelHdl->m_vecInputNodesDims[i].size(),
                    ONNX_TENSOR_ELEMENT_DATA_TYPE_UINT8,
                    &input_tensor));
        } else if (cur_cida_tensor_param->type == DT_INT32) {
            CheckStatus(g_pOrt->CreateTensorWithDataAsOrtValue(
                    memory_info,
                    cur_cida_tensor->pValue,
                    cur_cida_tensor->nValueLen,
                    ptModelHdl->m_vecInputNodesDims[i].data(),
                    ptModelHdl->m_vecInputNodesDims[i].size(),
                    ONNX_TENSOR_ELEMENT_DATA_TYPE_INT32,
                    &input_tensor));
        } else {
            std::cout << "Now the tensor data type  = " << cur_cida_tensor_param->type << "  is  not supported!!!"
                      << std::endl;
            g_onnx_mutex.unlock();
            return CIDA_FAILED;
        }

        g_pOrt->ReleaseMemoryInfo(memory_info);

        input_tensors.emplace_back(input_tensor);
//        std::cout << "[=I=] ptModelHdl->m_vecInputNodesName[" << i << "] = " << ptModelHdl->m_vecInputNodesName[i]
//                  << std::endl;
        g_pOrt->BindInput(binding, ptModelHdl->m_vecInputNodesName[i], input_tensor);
    }

    //Output tensor
    OrtValue *output_tensor = NULL;
    std::vector<OrtValue *> output_tensors;
    for (int i = 0; i < output_tensor_array->nArraySize; i++) {
        cida_tensor_t *cur_cida_tensor = &(output_tensor_array->pTensorArray[i]);
        cida_tensor_params_t *cur_cida_tensor_param = cur_cida_tensor->pTensorParams;

        for (int j = 0; j < cur_cida_tensor_param->nDims; j++) {
            if (cur_cida_tensor_param->pShape[j] <= 0) {
                std::cout << "Tensor " << cur_cida_tensor_param->pTensorName
                          << " shape[ " << j << " ] should be  > 0" << std::endl;
                g_onnx_mutex.unlock();
                return CIDA_FAILED;
            }
        }

        cida::cidaGetTensorSize(cur_cida_tensor);

        ptModelHdl->m_vecOutputNodesDims[i].clear();
        for (int j = 0; j < cur_cida_tensor_param->nDims; j++) {
            ptModelHdl->m_vecOutputNodesDims[i].push_back(cur_cida_tensor_param->pShape[j]);
        }

        OrtMemoryInfo *memory_info;

        if (cur_cida_tensor_param->tensorMemType == CIDA_CPU_MEM_ALLOC ||
            cur_cida_tensor_param->tensorMemType == CIDA_CPU_MEM_NO_ALLOC) {
            CheckStatus(g_pOrt->CreateCpuMemoryInfo(OrtArenaAllocator, OrtMemTypeDefault, &memory_info));
        } else if (cur_cida_tensor_param->tensorMemType == CIDA_GPU_MEM_ALLOC ||
                   cur_cida_tensor_param->tensorMemType == CIDA_GPU_MEM_NO_ALLOC) {
            std::cout << "[Error] Now onnx model the gpu output only support CUDA, not support TensorRT!" << std::endl;
            exit(-1);
            CheckStatus(g_pOrt->CreateMemoryInfo("Cuda", OrtArenaAllocator, 0, OrtMemTypeDefault, &memory_info));
        }

        if (cur_cida_tensor_param->type == DT_FLOAT) {
            CheckStatus(g_pOrt->CreateTensorWithDataAsOrtValue(
                    memory_info,
                    cur_cida_tensor->pValue,
                    cur_cida_tensor->nValueLen,
                    ptModelHdl->m_vecOutputNodesDims[i].data(),
                    ptModelHdl->m_vecOutputNodesDims[i].size(),
                    ONNX_TENSOR_ELEMENT_DATA_TYPE_FLOAT,
                    &output_tensor));
        } else if (cur_cida_tensor_param->type == DT_UINT8) {
            CheckStatus(g_pOrt->CreateTensorWithDataAsOrtValue(
                    memory_info,
                    cur_cida_tensor->pValue,
                    cur_cida_tensor->nValueLen,
                    ptModelHdl->m_vecOutputNodesDims[i].data(),
                    ptModelHdl->m_vecInputNodesDims[i].size(),
                    ONNX_TENSOR_ELEMENT_DATA_TYPE_UINT8,
