            return CIDA_FAILED;
        }

        g_pOrt->ReleaseMemoryInfo(memory_info);

        output_tensors.emplace_back(output_tensor);
//        std::cout << "[=I=] ptModelHdl->m_vecOutputNodesName[" << i << "] = " << ptModelHdl->m_vecOutputNodesName[i]
//                  << std::endl;
        g_pOrt->BindOutput(binding, ptModelHdl->m_vecOutputNodesName[i], output_tensor);
    }


    // auto t_start = std::chrono::high_resolution_clock::now();

    CheckStatus(g_pOrt->RunWithBinding(ptModelHdl->m_pSession, ptModelHdl->m_pRunOPtions, binding));

    // auto t_end = std::chrono::high_resolution_clock::now();
    // float ms = std::chrono::duration<float, std::milli>(t_end - t_start).count();
    // std::cout << "inference time:  " << ms << " ms." << std::endl;

    // Release input/output tensor if set
    for (auto &tensor : input_tensors) {
        if (tensor != nullptr) {
            g_pOrt->ReleaseValue(tensor);
        }
    }

    for (auto &tensor : output_tensors) {
        if (tensor != nullptr) {
            g_pOrt->ReleaseValue(tensor);
        }
    }

    input_tensors.clear();
    output_tensors.clear();

    g_pOrt->ClearBoundInputs(binding);
    g_pOrt->ClearBoundOutputs(binding);

    g_onnx_mutex.unlock();

    CIDA_DEBUG("End onnx  inference tensors succeed!!!\n");
    return CIDA_SUCCESS;
